import { useEffect, useState } from "react";
import Footer from "./Footer"
import Nav from "./Nav"
function Cart(){
    const [localdata,setlocaldata] = useState([])
    useEffect(()=>{
var  data = localStorage.getItem("cartdata");
var d = JSON.parse(data);
setlocaldata(d)
    },[])
    return(
        <>
        <Nav/>
        {d.map(e =>(
            <>
            <p>{e.pname}</p>
            <p>{e.price}</p>


            </>
        ))}
        <h1>this is cart page</h1>
        <Footer/>
        </>
    )
}
export default Cart;
